  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains voter registration
  data by month and county starting with January 2000.  It identifies the number of
  voters registered as Democrats, Republicans, other party or no party.  It also identifies
  the number of active and inactive voter registrations.  Inactive voters are those
  to whom official mailings have been sent from the county auditoru2019s office, the
  notice was returned as undeliverable by the United States Postal Service and the
  voter has not responded to a follow up confirmation notice. [u00a748A.37]\",\n\t\"license_title\":
